  var js = "// Toggles the menu tabs in banner\nfunction TogglePage(id,element){\n  var i, tabcontent, tablinks;\n  tabcontent = document.getElementsByClassName('coi-banner__page');\n  for (i = 0; i < tabcontent.length; i++) {\n    tabcontent[i].style.display = 'none';\n  }\n  // Get all elements with class='coi-banner-tab' and remove the class 'active'\n    tablinks = document.getElementsByClassName('coi-banner__nextpage');\n    for (i = 0; i < tablinks.length; i++) {\n        tablinks[i].className = tablinks[i].className.replace(' activeTab', '');\n    }\n  // Show the current tab, and add an 'active' class to the link that opened the tab\n    document.getElementById(element).style.display = 'block';\n    id.className += ' activeTab';\n}\n\nfunction showDescription(event, id, label) {\n  var isMobile = window.matchMedia('(max-width: 760px)').matches;\n  var categoryCheckbox = document.getElementById(id);\n  label.classList.toggle('active');\n  categoryCheckbox.checked = !categoryCheckbox.checked;\n  event.preventDefault();\n}\n\n/**\n * When all checkboxes are unchecked, show the \n */\nvar checkboxes = document.querySelectorAll('.coi__checkbox');\n\nfunction setCheckboxes(stat){\n  for (var i = 0; i < checkboxes.length; i++) {\n    if (checkboxes[i].type === 'checkbox') {\n      if (stat) {\n        if(!checkboxes[i].checked)  {\n          checkboxes[i].click();\n        }\n      } else  {\n        if (checkboxes[i].checked){\n          checkboxes[i].click();\n        }\n      }\n    }\n  }\n}\n\nfunction anyOptionChecked() {\n  var anyChecked = false;\n\n  for (var i = 0; i < checkboxes.length; i++) {\n    if (checkboxes[i].type === 'checkbox' && checkboxes[i].checked) {\n      anyChecked = true;\n    }\n  }\n\n  return anyChecked;\n}\n\nfunction updateConsentButtonText() {\n  var updateConsentButton = document.getElementById('coi-category-consent__update-consent');\n  var anyChecked = anyOptionChecked();\n\n  var necessaryCookiesBtnText = 'Accept only necessary';\n  var customCookiesBtnText = 'Change settings';\n\n  updateConsentButton.innerText =\n    anyChecked ? customCookiesBtnText : necessaryCookiesBtnText;\n}\n\nfunction setCheckboxLabel(el) {\n  var selectAll = document.getElementById('coi-banner__selectAll');\n  var deselectAll = document.getElementById('coi-banner__deselectAll');\n  \n  updateConsentButtonText();\n\n  if (el.type === 'checkbox' && el.checked) {\n    selectAll.style.display = 'none';\n    deselectAll.style.display = 'block';\n  } else {\n    selectAll.style.display = 'block';\n    deselectAll.style.display = 'none';\n  }\n}\n\nfor (var i = 0; i < checkboxes.length; i++) {\n  checkboxes[i].addEventListener('change', function() {\n    setCheckboxLabel(this);\n  });\n}\n\n/**\n * Popup bounce effect when user clicks on the background overlay\n */\nvar overlay = document.getElementById('coiOverlay');\n\noverlay.addEventListener('click', function(e) {\n  if (e.target === this) {\n    e.preventDefault;\n    var popup = document.getElementById('coi-banner-wrapper');\n    popup.classList.remove('bounce');\n    // -> triggering reflow /* The actual magic */\n    // without this it wouldn't work. Try uncommenting the line and the transition won't be retriggered.\n    popup.offsetWidth = overlay.offsetWidth;\n    // -> and re-adding the class\n    popup.classList.add('bounce');\n  }\n}, false);\n\n// Show and Hides the banner\nfunction showCookieBanner() {\n  var htmlElement = document.getElementsByTagName('html')[0];\n  var renewBtn = document.getElementById('Coi-Renew');\n  var coiOverlay = document.getElementById('coiOverlay');\n  var wrapper = document.getElementById('coi-banner-wrapper');\n  \n  coiOverlay.style.display = 'flex';\n  htmlElement.classList.add('noScroll');\n  renewBtn.style.display = 'none';\n  wrapper.setAttribute('aria-hidden','false');\n  wrapper.focus();\n  coiOverlay.setAttribute('aria-hidden','false');\n  \n  var checkboxes = document.querySelectorAll('.coi__checkbox');\n  for(var i = 0; i < checkboxes.length; i++){\n    setCheckboxLabel(checkboxes[i]);\n  } \n}\n\nfunction hideCookieBanner() {\n  var htmlElement = document.getElementsByTagName('html')[0];\n  var renewBtn = document.getElementById('Coi-Renew');\n  var wrapper = document.getElementById('coi-banner-wrapper');\n  var coiOverlay = document.getElementById('coiOverlay');\n  \n  wrapper.setAttribute('aria-hidden','true');\n  coiOverlay.setAttribute('aria-hidden','true');\n  coiOverlay.style.display = 'none';\n  htmlElement.classList.remove('noScroll');\n  renewBtn.style.display = 'none';\n}\n\n/**\n * Run on page load\n */\n(function(){\n  var imagePath = 'https://www.puregym.com/images/logo.png'; // Change this to your own logo URL\n  var container = document.getElementsByClassName('coi-banner__header');\n  for (var i = 0; i < container.length; i++){\n    var logo = document.createElement('img');\n    \n    logo.style.width = '150px'; // Change width for better fit\n    logo.style.height = '72px'; // Change width for better fit\n    \n    logo.src = imagePath;\n    logo.alt = 'logo';\n    container[i].insertBefore(logo, container[i].childNodes[0]);\n  }\n\n  updateConsentButtonText();\n})();";
